import React from "react";

function add(a, b) {
  return (sum = a + b);
}
function sub(a, b) {
  return (sub = a - b);
}
function mult(a, b) {
  return (mult = a * b);
}
function division(a, b) {
  return (division = a / b);
}

export { add, sub, mult, division };
